import React from 'react';

const CartSectionProduct = ({title, style, price, key}) => {
  return (
    <li className="list-group-item d-flex justify-content-between lh-condensed" id={key}>
          <div>
            <h6 className="my-0">{title}</h6>
            <small className="text-muted">{style}</small>
          </div>
          <span className="text-muted">{price}</span>
      </li>
  )
}

export default CartSectionProduct;
